import React from "react";
import "./event.css";
import {link} from 'react-router-dom'





export function MyComponents(){

    return(
      <div>
        <h2>UpComing Events</h2>
       <div className="section">
        <div className="sub">
            <h3>Web development Bootcamp 2023</h3>
            <h4></h4>
            <img src="./img/meet.png"/>
            <p>   We designed and built studio-style scenery that set the virtual
//              stage for executive presentations, differentiating this new
//              experience from the original live conference.</p>
             <button className="next" >Register</button>
             
        </div>
       

        <div className="sub">
           <h3>Artificial Intelligence</h3>
            <h4>June 7|Virtual</h4>
            <img src="./img/meet.png"/>
            <p>We Shall be talking the different technologies for communication as a tech community</p>
           <button className="next">Register</button>
        </div>


        <div className="sub">
            <h3>Women in tech</h3>
            <h4>Sept  11|Virtual</h4>
            <img src="./img/meet.png"/>
            <p>We shall be talking about different technologies for communication as a tech community</p>
           <button className="next">Register</button>
        </div>
        </div>


        <div className="section">
        <div className="sub">
            <h3>Google for Startups Accelerator UK</h3>
            <h4>Applications are open till May 20</h4>
            <img src="./img/meet.png"/>
            <p>Great opportunity for supporting technology startups that are in the feild of AI and Ml</p>
            <button className="next">Register</button>
        </div>
       

        <div className="sub">
           <h3>Artificial Intelligence</h3>
            <h4>June 7|Virtual</h4>
            <img src="./img/meet.png"/>
            <p>We shall be talking about  different technologies for communication as a tech community</p>
           <button className="next">Register</button>
        
        </div>


        <div className="sub">
            <h3>Women in tech</h3>
            <h4>Sept  11|Virtual</h4>
            <img src="./img/meet.png"/>
            <p>We will be talking about different technologies for communication as a tech community</p>
           <link to ='/forms'>
            <button className="next">Register</button>
            </link>
        
        </div>
        </div>



      

      </div>





    )

}
